import './App.css';
import Navbar from "./NavBar";
import HomePage from './HomePage';
import { Route, Routes, BrowserRouter } from 'react-router-dom';
import Projects from './Projects';
import AboutMe from './AboutMe';
import MazeGame from './MazeGame';
import MySkills from './MySkills'
import Marketplace from './MockTradingPlatform';

import moon from './images/space.jpg'
import mountains from './images/neatbg.png'
import dirt from './images/dirt.jpg'
import cat from './videos/cat.gif'
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import { useSpring, animated, useInView } from '@react-spring/web';
import { useRef } from 'react';

import Typewriter from "typewriter-effect";

function App() {

  const ref = useRef();

  const [ref1, inView] = useInView();

  return (
    <div>
      <Parallax pages={9} ref={ref}>
        <ParallaxLayer
          offset={0}
          speed={1}
          factor={1}
          onClick={()=> ref.current.scrollTo(1)}
          style={{
            backgroundImage: `url(${moon})`,
            backgroundSize: 'cover'
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          offset={1}
          speed={1}
          factor={1}
          onClick={()=> ref.current.scrollTo(2)}
          style={{
            backgroundImage: `url(${mountains})`,
            backgroundSize: 'cover'
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          offset={0.2}
          speed={0.05}
          onClick={()=> ref.current.scrollTo(1)}
        >
        <div className="App">
            <animated.div>
              <Typewriter
                onInit={(typewriter) => {
                  typewriter.typeString("Hi, I'm Nemanja!").start();
                }}
              />
            </animated.div>
          </div>
        </ParallaxLayer>

        <ParallaxLayer
          offset={1.2}
          speed={0.05}
          onClick={()=> ref.current.scrollTo(2)}
        >
          <div className="App">
            <animated.div>
              <Typewriter
                onInit={(typewriter) => {
                  typewriter.typeString("And this is my website!").start();
                }}
              />
            </animated.div>
          </div>
        </ParallaxLayer>

        <ParallaxLayer
          offset={2}
          speed={1}
          factor={1}
          onClick={()=> ref.current.scrollTo(3)}
        >
          <Projects/>
        </ParallaxLayer>

        <ParallaxLayer
          offset={3}
          speed={1}
          factor={2}
          onClick={()=> ref.current.scrollTo(5)}
        >
          <MazeGame />
        </ParallaxLayer> 

        <ParallaxLayer
        offset={5}
        speed={1}
        factor={2}
        onClick={()=> ref.current.scrollTo(7)}
        >
          <Marketplace/>
        </ParallaxLayer>

        <ParallaxLayer
        offset={7}
        speed={1}
        factor={1}
        onClick={()=> ref.current.scrollTo(8)}
        >
          <MySkills/>
        </ParallaxLayer>

        <ParallaxLayer
        offset={8}
        speed={1}
        factor={1}
        >
          <AboutMe/>
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default App;
